INSERT INTO `t_reviews` VALUES (5,'Bìa cứng, giấy chất lượng, nội dung ý nghĩa. 10 điểm',1,'13db1309-6ca0-4a3e-9ce3-8396f0b2deb3','0ca92842-5b44-4c56-8d05-c091c76d8c26','2f8fa602-7c34-4283-bc2e-e2cf2d6879c4','2024-10-30 00:30:26','2024-10-30 00:30:26'),(2,'Sản phẩm tệ, bìa sách bị móp, giao hàng chậm chạp. Rất không hài lòng về dịch vụ vận chuyển',1,'13db1309-6ca0-4a3e-9ce3-8396f0b2deb3','0ca92842-5b44-4c56-8d05-c091c76d8c26','96ca111d-53ba-4f93-9dee-ef5cf5243f22','2024-10-30 01:06:37','2024-10-30 01:06:37'),(4,'Sản phẩm khá hay. Với các kiến thức được truyền tải trong quyển này, tôi có thể áp dụng khá nhiều trong cuộc sống.',1,'13db1309-6ca0-4a3e-9ce3-8396f0b2deb3','0ca92842-5b44-4c56-8d05-c091c76d8c26','a3e32316-4d63-48d9-9950-910761b4e434','2024-10-29 23:09:59','2024-10-29 17:44:58'),(1,'Đánh giá vi phạm chính sách tiêu chuẩn cộng đồng của chúng tôi!',0,'13db1309-6ca0-4a3e-9ce3-8396f0b2deb3','0ca92842-5b44-4c56-8d05-c091c76d8c26','c76cd264-1d69-4004-b796-45da86587ac1','2024-10-30 00:31:32','2024-10-29 17:33:25'),(4,'Đây là cuốn sách tôi muốn có trong tủ sách.\nChi tiết nội dung khá hay tuy nhiên vẫn có một số lỗi ở phần hoàn thiện sản phẩm, mong sẽ được cải thiện trong thời gian sắp tới.',1,'13db1309-6ca0-4a3e-9ce3-8396f0b2deb3','0ca92842-5b44-4c56-8d05-c091c76d8c26','e8846cb5-1c1b-4a33-86f0-138535010b50','2024-10-30 01:01:54','2024-10-30 01:01:54'),(5,'Kiểu dáng đẹp đẽ, cấu hình vừa đủ. Sử dụng hàng ngày không có vấn đề gì. Quà tặng cho gia đình rất hợp lí.',1,'586c6b6e-7e86-4bb5-9671-48691a146c95','0740bc7a-655c-447d-8b46-d952c8703ebd','e33000cf-6c87-4630-a996-4bd2d619b32f','2024-10-29 18:19:04','2024-10-29 18:19:04'),(5,'Cuốn sách này đọc rất cuốn hút, chúng ta có thể hiểu rõ hơn về tiền, thị trường và các vấn đề liên quan! Rất đáng để ủng họ',1,'586c6b6e-7e86-4bb5-9671-48691a146c95','0ca92842-5b44-4c56-8d05-c091c76d8c26','bbfc3ff5-8200-4418-8c4d-d7f6153d79d9','2024-10-29 18:30:30','2024-10-29 18:30:30'),(5,'Quyển sách này rất hay!\nGiúp tôi hiểu được nhiều điều về cuộc sống, cũng như là tìm hiểu được nhiều hơn về văn hóa của nhiều nước trên thế giới.\n',1,'586c6b6e-7e86-4bb5-9671-48691a146c95','1630dfe4-3f35-4e99-b9ec-1673444fd160','e33000cf-6c87-4630-a996-4bd2d619b32f','2024-10-29 17:59:43','2024-10-29 17:59:43'),(5,'Tôi mua sản phẩm này để tặng bạn gái dịp lễ. Bạn ấy khen nó rất đẹp. Sẽ tiếp tục ủng họ lần sau',1,'586c6b6e-7e86-4bb5-9671-48691a146c95','18cd5220-e55c-4551-85b8-adb2cb3e7ca0','e33000cf-6c87-4630-a996-4bd2d619b32f','2024-10-30 00:43:27','2024-10-30 00:43:27');
/*!40000 ALTER TABLE `t_reviews` ENABLE KEYS */;
